package e233

import "testing"

func Test_maxAscendingSum(t *testing.T) {
	type args struct {
		nums []int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{"1", args{[]int{10, 20, 30, 5, 10, 50}}, 65},
		{"1", args{[]int{10, 20, 30, 40, 50}}, 150},
		{"1", args{[]int{12, 17, 15, 13, 10, 11, 12}}, 33},
		{"1", args{[]int{100, 10, 1}}, 100},
		{"1", args{[]int{5, 5, 6, 6, 6, 9, 1, 2}}, 15},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := maxAscendingSum(tt.args.nums); got != tt.want {
				t.Errorf("maxAscendingSum() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_getNumberOfBacklogOrders(t *testing.T) {
	type args struct {
		orders [][]int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		// [[10,5,0],[15,2,1],[25,1,1],[30,4,0]]
		{"1", args{[][]int{{10, 5, 0}, {15, 2, 1}, {25, 1, 1}, {30, 4, 0}}}, 6},
		// [[7,1000000000,1],[15,3,0],[5,999999995,0],[5,1,1]]
		{"1", args{[][]int{{7, 1000000000, 1}, {15, 3, 0}, {5, 999999995, 0}, {5, 1, 1}}}, 999999984},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := getNumberOfBacklogOrders(tt.args.orders); got != tt.want {
				t.Errorf("getNumberOfBacklogOrders() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_maxValue(t *testing.T) {
	type args struct {
		n      int
		index  int
		maxSum int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{"1", args{4, 2, 6}, 2},
		{"2", args{6, 1, 10}, 3},
		{"3", args{3, 2, 18}, 7},
		{"4", args{2, 0, 798870804}, 399435402},
		{"5", args{5, 0, 28}, 7},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := maxValue(tt.args.n, tt.args.index, tt.args.maxSum); got != tt.want {
				t.Errorf("maxValue() = %v, want %v", got, tt.want)
			}
		})
	}
}

